import './App.css';



import {
  init,
  AppEmbed,
  Action,
  RuntimeFilterOp,
  EmbedEvent,
  AuthType,
  Page
} from "@thoughtspot/visual-embed-sdk";


 const TSURL = "https://my3.thoughtspot.cloud";
 init({
  thoughtSpotHost: TSURL,
  authType: AuthType.None
});


function App() {
 return (
   <div className="App">

<div>
           <h1>THOUGHTSPOT VISULISATIONS</h1>
           <AppEmbed frameParams={{height: "80vw"}} 
                pageId={"Page.Home"} />

       </div>  


   </div>
 );
}
export default App;
